import { SignUp } from 'components';
import React from 'react';
const Component = () => {

    const onSubmit = async (data, e) => {

        if (data.password === data.passwordValidate) {
            console.log(data);
            return e.reset()
        }

        console.log("error")
    }
    return (

        <SignUp onSubmit={onSubmit} />
    );
}

export default Component;
export { Component as SignUpPage }
